import React from "react";
import { useSelector } from "react-redux";

function NewShowUser() {
  const users = useSelector((state) => state.users.value);
  return (
    <div>
      {users.map((x) => (
        <div> {x.username}</div>
      ))}
    </div>
  );
}

export default NewShowUser;
